import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import { ReactComponent as Photo } from "../media/photo.svg";
import "../styles/WelcomeStyles.css";


const Welcome = () => {
  return (
    <Container>
        <Row>
            <Col sm={4}>
                Title
            </Col>
            <Col sm={8}>
                <Photo style={{ width: "40rem" }} />
            </Col>
        </Row>
    </Container>    
  )
};

export default Welcome;
